selector_to_html = {"a[href=\"#user-staff-view-user-details\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">View Staff User\u2019s Details<a class=\"headerlink\" href=\"#view-staff-user-s-details\" title=\"Link to this heading\">#</a></h2><p>To view a <strong>Staff User\u2019s</strong> details:</p>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../_images/PrimarySidebar-Open.webp\"><img alt=\"../../_images/PrimarySidebar-Open.webp\" loading=\"lazy\" src=\"../../_images/PrimarySidebar-Open.webp\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Sidebar Expanded</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#status-column\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Status Column<a class=\"headerlink\" href=\"#status-column\" title=\"Link to this heading\">#</a></h2><p>The <strong>Status</strong> column indicates the current status of the account. The following statuses are available:</p>", "a[href=\"#staff-list-columns\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Staff List Columns<a class=\"headerlink\" href=\"#staff-list-columns\" title=\"Link to this heading\">#</a></h2><p>The <span class=\"table-reference\"><span class=\"visually-hidden\">Table: </span><span>Staff List Table</span></span> includes a table of accounts with the following columns:</p>", "a[href=\"#staff\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Staff<a class=\"headerlink\" href=\"#staff\" title=\"Link to this heading\">#</a></h1><p>The <span class=\"page-reference\"><span class=\"visually-hidden\">Page: </span><span>Staff Page</span></span> opens up to the <span class=\"table-reference\"><span class=\"visually-hidden\">Table: </span><span>Staff List Table</span></span>:</p>", "a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../_images/staff-homepage-columns-action-location.webp\" id=\"staff-user-action-column\"><img alt=\"../../_images/staff-homepage-columns-action-location.webp\" id=\"staff-user-action-column\" loading=\"lazy\" src=\"../../_images/staff-homepage-columns-action-location.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, Staff Homepage, Action Column</span><a class=\"headerlink\" href=\"#id4\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../_images/PrimarySidebar-toggle.webp\"><img alt=\"../../_images/PrimarySidebar-toggle.webp\" loading=\"lazy\" src=\"../../_images/PrimarySidebar-toggle.webp\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Toggle Primary Sidebar button.</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#remaining-sections\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Remaining Sections<a class=\"headerlink\" href=\"#remaining-sections\" title=\"Link to this heading\">#</a></h3><p>The remaining sections are universally shared throughout the app.</p><p><strong>These sections include:</strong></p>", "a[href=\"../../Universal/InformationPane/information-pane.html#information-pane-main-page\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Information Pane<a class=\"headerlink\" href=\"#information-pane\" title=\"Link to this heading\">#</a></h1><p>The <strong>Information Pane</strong> (Right Column) provides both an <strong>Activity Log</strong> and a <strong>Created &amp; Modified</strong> Section.</p>", "a[href=\"../../Universal/DeleteUser/delete-user-universal.html#delete-user-universal\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">How to Delete User, Staff, Company, etc.<a class=\"headerlink\" href=\"#how-to-delete-user-staff-company-etc\" title=\"Link to this heading\">#</a></h1><p>To delete a user, staff, company, or anything else throughout the app, follow these steps:</p>", "a[href=\"../../Universal/UserDetails/view-user-details-accounts-tab.html#user-details-accounts-tab\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">User Details - Accounts Tab<a class=\"headerlink\" href=\"#user-details-accounts-tab\" title=\"Link to this heading\">#</a></h1><p>The <span class=\"page-reference\"><span class=\"visually-hidden\">Page: </span><span>User Details</span></span> page also has an <span class=\"tab-reference\"><span class=\"visually-hidden\">Tab: </span><span>Accounts</span></span> tab that allows you to view the accounts associated with the user.</p>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../_images/staff-homepage-columns-view-user-details-location.webp\" id=\"user-staff-view-more-location\"><img alt=\"../../_images/staff-homepage-columns-view-user-details-location.webp\" id=\"user-staff-view-more-location\" loading=\"lazy\" src=\"../../_images/staff-homepage-columns-view-user-details-location.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, Staff Homepage, View More Icon Location</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../_images/PrimarySidebar-Collapsed.webp\"><img alt=\"../../_images/PrimarySidebar-Collapsed.webp\" loading=\"lazy\" src=\"../../_images/PrimarySidebar-Collapsed.webp\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Collapsed Primary Sidebar</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#view-staff-user-s-details\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">View Staff User\u2019s Details<a class=\"headerlink\" href=\"#view-staff-user-s-details\" title=\"Link to this heading\">#</a></h2><p>To view a <strong>Staff User\u2019s</strong> details:</p>", "a[href=\"../../Universal/UserDetails/user-details-page.html#user-details-universal-page\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">User Details Page<a class=\"headerlink\" href=\"#user-details-page\" title=\"Link to this heading\">#</a></h1><p>The <span class=\"page-reference\"><span class=\"visually-hidden\">Page: </span><span>User Details Page</span></span> opens up to the <span class=\"tab-reference\"><span class=\"visually-hidden\">Tab: </span><span>User Information</span></span> Tab</p>", "a[href=\"../../Universal/EditPermissions/edit-permissions.html#edit-permissions-universal\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Edit Permissions<a class=\"headerlink\" href=\"#edit-permissions\" title=\"Link to this heading\">#</a></h1><p>You can edit permissions for various types of users throughout the app.</p><p><strong>To Edit Permissions:</strong></p>", "a[href=\"#view-more-icon\"]": "<img src='/en/stable-edit/_static/solo_app/Universal/icons/view-more-icon.jpeg' alt='View More Icon' style='width:200px;'>", "a[href=\"#menu-icon\"]": "<img src='/en/stable-edit/_static/solo_app/Universal/icons/menu-icon.jpeg' alt='Menu Icon' style='width:100%;'>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
